import React from 'react';
import './about.css';

export default function () {
  const lines = ['so...what\'s an algorithm?',
    'and why do we need them?',
    'and what do they look like?'
  ]
  return (
    <div className='lines'>
      {lines.map(line => {
        setTimeout(() => {
          <div className='line'> <p>{line}</p> </div>
        })
      })}
    </div>
  )
}
